    super();
    this.state = {
      students : []
    }
  }
  componentDidMount() {
  

  }
  render(){
    return (
      <div className="Dashboard">
        <div className="container">
          <div className="row">

            <article className="col-md-10">

              <section>
                <header>header1</header>
                  <div id="general-info">
                  <div class="card" style="width: 18rem;">  
                      <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <p class="card-text">.</p>
    <a href="#" class="btn btn-primary">Go somewhere</a>
  </div>
</div>
                    <div id="best-courses">best courses</div>
                    <div id="popular-bacfield">popular field</div>
                    <div id="best-bacfield">best field</div>
                    <div id="best-gender">best gender</div>
                  </div>              
              </section>

              <section>
                <header>header2</header>
                <div id="year-analysis"></div>
              </section>  

            </article>

            <aside className="col-md-2">

              <div>

              </div>
            </aside>

          </div>    
        </div>
      </div>
      
      
    );
  }
 
}

export default  Dashboard;
